import React from "react";
import styles from "./ReplyButton.module.css";

const ReplyButton = ({ activateReplyForm }) => {
  return (
    <button
      className={styles.replyButton}
      onClick={() => activateReplyForm(true)}
    >
      Reply
    </button>
  );
};

export default ReplyButton;
